    const { pais, ciudad } = useParams();

    return(
            <Container maxWidth="md">
                <h2>Nosotros</h2>
                <p>Pais: {name}</p>
                <p>Apellido: {apellido}</p>
            </Container>
    )
}
export default Nosotros;
